import React from 'react';
import { Card, Table, Row, Col } from 'react-bootstrap';

import './../../style/Style.css';


class Schedule extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            lessons: [],
            schedule: ''
        };
    }

    componentDidMount() {

    }


    render() {


        return (
            <div>

                <Card className={"border border-dark bg-dark text-white"}>
                    <Card.Header>


                    </Card.Header>
                    <Card.Body>
                        <Table striped bordered hover variant="dark">
                            <thead>
                                <tr>
                                    <th>Instructor</th>
                                    <th>9:00</th>
                                    <th>10:00</th>
                                    <th>11:00</th>
                                    <th>12:00</th>
                                    <th>13:00</th>
                                    <th>14:00</th>
                                    <th>15:00</th>
                                    <th>16:00</th>
                                    <th>17:00</th>
                                    <th>18:00</th>
                                    <th>19:00</th>
                                    <th>20:00</th>

                                </tr>
                            </thead>


                            <tbody>
                                {this.state.lessons.length === 0 ?
                                    <tr align="center">
                                        <td colSpan="10"> No Lessons in the Data Base</td>
                                    </tr> :

                                    this.state.lessons.map(lesson => (
                                        <tr key={lesson.id}>
                                            <td>{lesson.instructor.firstName + " " + lesson.instructor.lastName}</td>
                                            <td>{lesson.student.firstName + " " + lesson.student.lastName}</td>
                                            <td>{lesson.date}</td>
                                            <td>{lesson.time}</td>
                                            <td>{lesson.howLong}</td>
                                            <td>{lesson.nrStudents}</td>
                                            <td>{lesson.status}</td>


                                        </tr>
                                    ))
                                }
                            </tbody>
                        </Table>
                    </Card.Body>
                    <Card.Footer>



                    </Card.Footer>
                </Card>
            </div>

        );
    }


}

export default Schedule;
